import React from "react"

export const Personal_Despenser = (props) => {

    switch (typeof props.list){
        
        case ('object'): return <React.Fragment>

            <p className="Single_Supporters_Name"> {props.list.firstName} {props.list.lastname}</p>
            <p className="Single_Supporters_Instruction"> Currently employed at {props.list.company.name}</p>
            <p className="Single_Supporters_Instruction"> As {props.list.company.title}</p>

        </React.Fragment>


        case ('undefined'): return 'undefined'
    
    }
}

export default Personal_Despenser
